const DetailsList = styled.ul``;

const DetailsItem = styled.li``;

const ShowMoreBtn = styled.div``;

export {
    Item, 
    Image,
    InfoContainer,
    TitleWrapper,
    Title,
    PriceWrapper,
    FavoriteBtn,
    ReviewWrapper,
    Text,
    Description,
    DetailsList,
    DetailsItem,
